    const navigate = useNavigate();
    const {pathname} = useLocation();
    // const log = localStorage.removeItem()
    // console.log(log);
    let tokenValue=localStorage.getItem('token')
   if(!tokenValue){
       return <Navigate pathname='/' element={<Login/>}/>
   }
   
    return <Outlet />;
    
}
